import React from 'react';

const Notifications = () => {
  return (
    <div className="notifications">
      <h1>Notifications</h1>
      <div className="notifications-content">
        <p>Notification settings and management will be implemented here.</p>
      </div>
    </div>
  );
};

export default Notifications;
